#  The below ascii art was created using the original drawn image and https://www.text-image.com/convert/ascii.html
#  I also manually replaced all non-alphabet characters with the same letter in order to make the quinification work
source_ascii_art = """















































































































































"""

quinify = lambda x:"s='s=%r;print(s%%s)';print(s%s)".replace('s',x+'x')  # This code was taken from https://codegolf.stackexchange.com/questions/118373/print-a-quine-that-contains-the-input
print(quinify(source_ascii_art.replace("\n", "")))  # Prints out the quinified string and pipes to a new file called `infinity_quine.txt`
